const Index = (props) => {
  return (
    <Layout>
      <div className='main'>
        <div className='main-intro'>
          Hi I'm Noah, <br />I like building stuff online.
        </div>
        <div className='sub-intro'>
          Check out, my projects below
          and feel free to get in touch 
          if you have any projects in mind.
        </div>
      </div>
      <style jsx>{`
      .main-intro {
        font-size: 2.5rem;
        line-height: 2.7rem;
        margin-bottom: 15px;
      }  
      .sub-intro {
        font-size: 1.5rem;
        max-width: 400px;
      }
      .main {
        margin-top: 50px;
      }

      `}</style>
    </Layout>
  )
}

export default Index
